import React, { Component } from 'react'

export default class Home extends Component {
  render() {
    return (
        <div>
        <img src={this.props.setPaint} alt="Paint/" /> 
        <h1 className="name">{find.name}</h1>
      <p className="id">{find._id}</p>
      <p className="price">{find.price}</p>
        </div>
    )
  }
}
